import React from 'react';

import Social from '../Login/Social/Social';
import '../auth.css';

const Wrapper = (props) => (
    <div className="Page">
        <div className="Register">
                <h1 className="login-form-title">{props.title}</h1>
                {props.form}
                {props.social && <Social />}

        </div>  
    </div> 
)

export default Wrapper
